	LOOP(All4, 1,6,1)

        Sub637(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(CB2*F2*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &         Sub596(All5,Cha4,Ind1)*Sub616(All4,All5,Ind3,Ind4)*
     &         Sub617(All4,Cha4,Ind2) + 
     &        2*F1*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &         Mf(bH,gno2)*Sub613(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &         UChaC(Cha4,2)))/S2B**2

        Sub618(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(CB2*F1*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &         Sub596(All5,Cha4,Ind1)*Sub616(All4,All5,Ind3,Ind4)*
     &         Sub617(All4,Cha4,Ind2) + 
     &        2*F2*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &         Mf(bH,gno2)*Sub613(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &         UChaC(Cha4,2)))/S2B**2

        Sub638(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(CB2*F2*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &         Sub596(All5,Cha4,Ind1)*Sub617(All4,Cha4,Ind2)*
     &         Sub628(All4,All5,Ind3,Ind4) + 
     &        2*F1*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &         Mf(bH,gno2)*Sub625(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &         UChaC(Cha4,2)))/S2B**2

        Sub629(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(CB2*F1*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &         Sub596(All5,Cha4,Ind1)*Sub617(All4,Cha4,Ind2)*
     &         Sub628(All4,All5,Ind3,Ind4) + 
     &        2*F2*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &         Mf(bH,gno2)*Sub625(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &         UChaC(Cha4,2)))/S2B**2

        Sub640(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   -(4*cI*(3*CB2*F2*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &          Sub596(All5,Cha4,Ind1)*Sub617(All4,Cha4,Ind2)*
     &          Sub634(All4,All5,Ind3,Ind4) + 
     &         6*F1*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &          Mf(bH,gno2)*Sub631(All4,All5,Ind1,Ind2)*
     &          UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*
     &          UCha(Cha4,2)*UChaC(Cha4,2))/S2B**2)

        Sub635(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   -(4*cI*(3*CB2*F1*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &          Sub596(All5,Cha4,Ind1)*Sub617(All4,Cha4,Ind2)*
     &          Sub634(All4,All5,Ind3,Ind4) + 
     &         6*F2*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &          Mf(bH,gno2)*Sub631(All4,All5,Ind1,Ind2)*
     &          UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*
     &          UCha(Cha4,2)*UChaC(Cha4,2))/S2B**2)

        Sub630(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   Sub618(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,1,uzext1) - 
     &    Sub629(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,2,uzext1)

        Sub639(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   Sub637(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,1,uzext1) - 
     &    Sub638(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,2,uzext1)

        Sub636(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (TB*Sub630(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) + 
     &      CW*SB*Sub635(All4,All5,Cha4,Ind1,Ind2,Ind3,
     &        Ind4)*XHiggs(hno,3,uzext1))/(CW*SB*TB)

        Sub641(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (TB*Sub639(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) + 
     &      CW*SB*Sub640(All4,All5,Cha4,Ind1,Ind2,Ind3,
     &        Ind4)*XHiggs(hno,3,uzext1))/(CW*SB*TB)

        Sub642(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   m3*pave16(PVC(cc2),All4,All5,Cha4)*
     &     Sub636(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) + 
     &    m2*pave16(PVC(cc1),All4,All5,Cha4)*
     &     Sub641(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)

	ENDLOOP(All4)
	ENDLOOP(All5)
	ENDLOOP(Cha4)
	ENDLOOP(Ind1)
	ENDLOOP(Ind2)
	ENDLOOP(Ind3)
	ENDLOOP(Ind4)

	end
